import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Services from './pages/Services';
import SignUp from './pages/SignUp';
import SignIn from './pages/SignIn';
import BecomeTasker from './pages/BecomeTasker';
import CleaningWork from './pages/CleaningWork';
import ConstructionWork from './pages/ConstructionWork';
import DeliveryWork from './pages/DeliveryWork';
import FieldWork from './pages/FieldWork';
import Footer from './components/Footer';
import AuthLanding from './pages/AuthLanding';
//const userRoutes = require('../backend/routes/user');
//app.use('/user', userRoutes);
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen">
        <Navbar />
        <div className="flex-grow">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/services" element={<Services />} />
            <Route path="/authlanding" element={<AuthLanding />} />
            <Route path="/signin" element={<SignIn />} />  {/* Route SignIn */}
            <Route path="/signup" element={<SignUp />} />  
            <Route path="/become-tasker" element={<BecomeTasker />} />
            <Route path="/cleaning-work" element={<CleaningWork />} />
            <Route path="/construction-work" element={<ConstructionWork />} />
            <Route path="/delivery-work" element={<DeliveryWork />} />
            <Route path="/field-work" element={<FieldWork />} />
          </Routes>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
